import React from 'react';
import { FaUser, FaSearch, FaEnvelope } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import '/home/rguktongole/Desktop/ideanexus/frontend/src/components/dashboard/UserDashboard.css';

const UserDashboard = () => {
  const navigate = useNavigate();

  const handleProfileClick = () => {
    navigate('/profile');
  };

  const handleMessageClick = () => {
    navigate('/chats');
  };

  return (
    <div className="dashboard-container">
      <div className="navbar">
        <div className="profile-icon" onClick={handleProfileClick}>
          <FaUser size={30} />
        </div>
        <div className="search-bar">
          <input type="text" placeholder="Search..." />
          <FaSearch size={20} />
        </div>
        <div className="message-icon" onClick={handleMessageClick}>
          <FaEnvelope size={30} />
        </div>
      </div>

      <div className="dashboard-content">
        <h2>Welcome to your Dashboard</h2>
        {/* Add content for your dashboard */}
      </div>
    </div>
  );
};

export default UserDashboard;
